create table seats_reserved
(
    id              int not null
        primary key,
    seats_id        int not null,
    reservations_id int not null,
    screenings_id   int not null,
    constraint seats_reseved_reservations
        foreign key (reservations_id) references reservations (id),
    constraint seats_reseved_screenings
        foreign key (screenings_id) references screenings (id),
    constraint seats_reseved_seats
        foreign key (seats_id) references seats (id)
);

